	('2008120188', 'RETENCION NO REVERSADA', '&lt;div dir="ltr"&gt;&lt;div class="gmail_default" style="font-family: arial,helvetica,sans-serif; font-size: small;"&gt;Buenas tardes&lt;/div&gt;&lt;div class="gmail_default" style="font-family: arial,helvetica,sans-serif; font-size: small;"&gt; &lt;/div&gt;&lt;div class="gmail_default" style="font-family: arial,helvetica,sans-serif; font-size: small;"&gt;Sirva la presente para solicitar de su apoyo y colaboración con respecto a este inconveniente que se esta presentando.&lt;/div&gt;&lt;div class="gmail_default" style="font-family: arial,helvetica,sans-serif; font-size: small;"&gt;El día de hoy reverse la factura n°6703 del proveedor BELKYS MARINA PINTO recibo n° 95155 la factura se reverso sin problemas pero en el sistema aun me aparece la retención de la misma, necesito que esta sea eliminada o se inactive del sistema para no declararla el día lunes al momento de enviar el TXT al dpto de Impuestos.&lt;/div&gt;&lt;div class="gmail_default" style="font-family: arial,helvetica,sans-serif; font-size: small;"&gt;Este documento se reverso ya que el proveedor anulo la factura sin consultarnos primero.&lt;/div&gt;&lt;div class="gmail_default" style="font-family: arial,helvetica,sans-serif; font-size: small;"&gt; &lt;/div&gt;&lt;div class="gmail_default" style="font-family: arial,helvetica,sans-serif; font-size: small;"&gt;Adjunto print como soporte&lt;/div&gt;&lt;div class="gmail_default" style="font-family: arial,helvetica,sans-serif; font-size: small;"&gt; &lt;/div&gt;&lt;div class="gmail_default" style="font-family: arial,helvetica,sans-serif; font-size: small;"&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40354&amp;tickets_id=2008120188" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40354&amp;tickets_id=2008120188" alt="12b4774e-d9d62df8-5f343a5406e5f9.46166834" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div