	('2008130041', 'Requerimiento de Auxitoria Externa - Listado de Facturacion x Codigo (Ej. 2019-2020)', '&lt;div dir="ltr"&gt;Buenos dias la presente es para solicitar el reporte de facturación por código para las empresas Febec, Beval y Sillaca, desde el 01-07-2019 al 30-06-2020 que se detalle por codigo de articulo, los cuales debe contener.&lt;div&gt; &lt;/div&gt;&lt;div&gt;1) Facturas Credito Bs&lt;/div&gt;&lt;div&gt;2) Facturas Almacen BS&lt;/div&gt;&lt;div&gt;3) Facturas Contado BS&lt;/div&gt;&lt;div&gt;4) Nota de Credito BS&lt;/div&gt;&lt;div&gt;5) Nota de Debito BS&lt;/div&gt;&lt;div&gt;6) Facturas Servicios (Solo Beval)&lt;/div&gt;&lt;div&gt;7) Facturas Sicadme en Bolivares y en dolares (Solo Febeca)&lt;/div&gt;&lt;div&gt;8) Notas de Credito Sicadme en Bolivares y en dolares (Solo Febeca)  &lt;/div&gt;&lt;div&gt;9) Bonificaciones Sicadme en Bolivares y en dolares (Solo Febeca)  &lt;/div&gt;&lt;div&gt;10) Notas de Debito Sicadme en Bolivares y en dolares (Solo Febeca)  &lt;/div&gt;&lt;div&gt;11) Facturas Internas Bs (Febeca y Sillaca)&lt;/div&gt;&lt;div&gt;12) Notas de Credito a Facturas Internas (Febeca y SIllaca).&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Las cabeceras deben contener al menos:&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;1) Tipo de documento&lt;/div&gt;&lt;div&gt;2) Documento&lt;/div&gt;&lt;div&gt;3) Código cliente&lt;/div&gt;&lt;div&gt;4) Razón Social,&lt;/div&gt;&lt;div&gt;5) RIF del cliente&lt;/div&gt;&lt;div&gt;6) Factura Afectada (en el caso de las bonificaciones ND y NC)&lt;/div&gt;&lt;div&gt;7) Fecha de Emisión&lt;/div&gt;&lt;div&gt;8) Codigo articulo&lt;/div&gt;&lt;div&gt;9) Descripcion del articulo&lt;/div&gt;&lt;div&gt;10) Cantidades&lt;/div&gt;&lt;div&gt;11) Costo Unitario&lt;/div&gt;&lt;div&gt;12) Base imponible&lt;/div&gt;&lt;div&gt;13) IVA&lt;/div&gt;&lt;div&gt;14) Bolivares total&lt;/div&gt;&lt;div&gt;15) Tasa (en el caso de las facturas, NC, ND y bonificaciones de las ventas en Sicadme).&lt;/div&gt;&lt;div&gt; &lt;/div