	('2008130049', 'Requerimiento de Auditoria Externa - Listado de Compras (Ej 2019-2020)', '&lt;div dir="ltr"&gt;Buenos dias la presente es para solicitar su apoyo referente al listado de recibos y devoluciones de compra mercancía y suministros realizado durante el ejercicio fiscal 2019-2020 (desde el 01-07-2019 al 30-06-2020) para las empresas Febeca, Beval y Sillaca.&lt;div&gt; &lt;/div&gt;&lt;div&gt;Los mimos deben contener al menos las siguientes cabeceras:&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;1) Tipo de documento (Recibo de Mercancia o Devolucion de Compras)&lt;/div&gt;&lt;div&gt;2) Numero de Recibo&lt;/div&gt;&lt;div&gt;3) Fecha de Creación&lt;/div&gt;&lt;div&gt;4) Fecha de Aprobación&lt;/div&gt;&lt;div&gt;5) Usuario que creo el Recibo&lt;/div&gt;&lt;div&gt;6) Usuario que Aprobó el Recibo&lt;/div&gt;&lt;div&gt;7) Código proveedor&lt;/div&gt;&lt;div&gt;8) Razón Social Proveedor&lt;/div&gt;&lt;div&gt;9) Codigo articulo&lt;/div&gt;&lt;div&gt;10) Descripcion del articulo&lt;/div&gt;&lt;div&gt;11) Cantidad del articulo&lt;/div&gt;&lt;div&gt;12) Costo unitario del articulo&lt;/div&gt;&lt;div&gt;13) Costo total del articulo&lt;/div&gt;&lt;div&gt;14) Número de OC asociado al recibo&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Los listado de compras deben coincidir el los montos totales mensuales que se reflejan en el Reporte 4.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Cabe destacar que dichos listado son requeridos en formato excel.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Saludos!&lt;/div&gt;&lt;div&gt; &lt;/div&gt;-- &lt;br /&gt;&lt;div class="gmail_signature" dir="ltr" data-smartmail="gmail_signature"&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div style="font-size: small;"&gt; &lt;/div&gt;&lt;div&gt;&lt;table style="color: #ffffff; vertical-align: -webkit-baseline-middle; font-family: Verdana; border-spacing: 0px;" cellpadding="0"&gt;&lt;tbody&gt;&lt;tr&gt;&lt;td&gt;&lt;table style="verti