, Venezuela&lt;/span&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', 'Ramo Mayoreo', 'Prisma', 'OF/01', '20513462', 'Aplicaciones > Reportes', 'Medium', 'Alvarez Gutierrez, Gabriel Alejandro ( INT-VE-141 )', '2020-08-13', '2020-08-13', NULL, NULL, '0.92', NULL, '5f3ac40303357979b54c405a', 'false'),
	('2008130051', 'Diferencia en monto a cobrar en divisas (Factura Impresa Vs. Política de Cobranza) Mayor Beval', '&lt;div dir="ltr"&gt;&lt;div&gt;Buenos días, &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;El presente es para notificar y solicitar su apoyo con el siguiente caso que se está presentando en la facturación de Mayor Beval y a la tasa de cambio que se está manejando.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Por un lado se observa que la tasa no coincide exactamente con alguna de las indicadas por la empresa a la fuerza de ventas para el cálculo de la cobranza.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Así como también, a pesar de que la política de cobranza indica que la tasa de cambio a utilizar para el cálculo de las divisas a cobrar debe ser la que se indicó el día de la negociación o fecha del pedido, se ha observado que esta premisa no se está cumpliendo ya que la factura está tomando una tasa similar a la del día de su emisión. &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Este inconveniente ha causado incertidumbre al momento de realizar la cobranza por parte de la fuerza de ventas, ya que según la política el monto a cobrar debería de ser mayor que el indicado en la factura pero el cliente se limita a cancelar netamente el impreso.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;u&gt;Expongo un par de ejemplos de la situación:&lt;/u&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Factura: A-3055108 cliente 3779188&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;El pedido fue realizado el día 05/08/2020, la tasa de cobranza para ese dia era 269.581,00 Bs/USD por lo que el monto en divisas de la factura debe ser:&lt;strong&gt; 461,64 USD&lt;/strong&gt; (124.450.366,37 Bs / 269.581,00 Bs/USD)&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Sin embargo, el monto en divisas reflejado en la factura indica &lt;strong&gt;443,67 USD &lt;/strong&gt;y se puede observar al dividir el monto total entre la cantidad de dólares, que la tasa utilizada es 280.502,09 Bs/USD, similar mas no exacta a la tasa del dia 06/08/2020 fecha de emisión (280.497,00 Bs/USD). &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Generando una diferencia de: &lt;strong&gt;17.97 USD&lt;/strong&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;strong&gt;Factura:&lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40435&amp;tickets_id=2008130051" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40435&amp;tickets_id=2008130051" alt="12b4774e-d9d62df8-5f3545849de084.15437950" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;strong&gt;Facturación desde la torre de control:&lt;/strong&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40434&amp;tickets_id=2008130051" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40434&amp;tickets_id=2008130051" alt="12b4774e-d9d62df8-5f35458478a395.27467668" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;strong&gt;Tasa de cambio en MB:&lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40436&amp;tickets_id=2008130051" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40436&amp;tickets_id=2008130051" alt="12b4774e-d9d62df8-5f354584ae0a59.17829581" width="166" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Factura&lt;strong&gt; A-3052239 &lt;/strong&gt;cliente &lt;strong&gt;0101176&lt;/strong&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;div&gt;El pedido fue realizado el día 13/07/2020, la tasa de cobranza para ese dia era 226.355 Bs/USD por lo que el monto en divisas de la factura debe ser:&lt;strong&gt; 92,15 USD&lt;/strong&gt; (20.858.315,70 Bs / 226.355 Bs/USD)&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Sin embargo, el monto en divisas reflejado en la factura indica &lt;strong&gt;90,23 USD &lt;/strong&gt;y se puede observar al dividir el monto total entre la cantidad de dólares, que la tasa utilizada es 231.168,30 Bs/USD, similar mas no exacta a la tasa del dia 15/07/2020 fecha de emisión (231.167,00 Bs/USD). &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Generando una diferencia de: &lt;strong&gt;1,92 USD&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;strong&gt;Factura:&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40438&amp;tickets_id=2008130051" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40438&amp;tickets_id=2008130051" alt="12b4774e-d9d62df8-5f354584f14de7.06459651" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;strong&gt;Facturación desde torre de control:&lt;/strong&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40437&amp;tickets_id=2008130051" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40437&amp;tickets_id=2008130051" alt="12b4774e-d9d62df8-5f354584c2c7f7.13449915" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;strong&gt;Tasa de cambio en MB: &lt;/strong&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40439&amp;tickets_id=2008130051" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40439&amp;tickets_id=