	('2008130056', 'Requerimiento de Auditoria Externa - Listado de Precios (Ej. 2019-2020)', '&lt;div dir="ltr"&gt;Buenos dias, la presente es para solicitar de su apoyo referente el listado de precios que ha estado activo durante el ejercicio fiscal 2019-2020 (desde el 01-07-2019 al 30-06-2020) para las empresas Febeca, Beval y Sillaca.&lt;div&gt; &lt;/div&gt;&lt;div&gt;Los mismos deben contener al menos las siguiente cabeceras:&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;1) ID.&lt;/div&gt;&lt;div&gt;2) Creado por&lt;/div&gt;&lt;div&gt;3) Aprobado por&lt;/div&gt;&lt;div&gt;4) CÓdigo proveedor&lt;/div&gt;&lt;div&gt;5) Razón social proveedor&lt;/div&gt;&lt;div&gt;6) Código Artículo&lt;/div&gt;&lt;div&gt;7) Descripción artículo&lt;/div&gt;&lt;div&gt;8) Precio en Bs o en US$ (si aplica)&lt;/div&gt;&lt;div&gt;9) Fecha de vigencia de la lista de precios (Desde  y hasta)&lt;/div&gt;&lt;div&gt;10) Motivo del cambio de la lista de precios&lt;/div&gt;&lt;div&gt;11) Status de la lista de precios.&lt;/div&gt;&lt;div&gt;12) Costo Mercado&lt;/div&gt;&lt;div&gt;13) % de contribución&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Cabe destacar que los mismos son requeridos en formato excel.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Saludos!&lt;br style="clear: both;" /&gt;&lt;div&gt; &lt;/div&gt;-- &lt;br /&gt;&lt;div class="gmail_signature" dir="ltr" data-smartmail="gmail_signature"&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div style="font-size: small;"&gt; &lt;/div&gt;&lt;div&gt;&lt;table style="color: #ffffff; vertical-align: -webkit-baseline-middle; font-family: Verdana; border-spacing: 0px;" cellpadding="0"&gt;&lt;tbody&gt;&lt;tr&gt;&lt;td&gt;&lt;table style="vertical-align: -webkit-baseline-middle; font-family: Verdana; border-spacing: 0px;" cellpadding="0"&gt;&lt;tbody&gt;&lt;tr&gt;&lt;td style="vertical-align: top;"&gt;&lt;table style="vertical-align: -webkit-baseline-middle; font-family: Verdana; border-spacin