	('2008130167', 'Pedidos no se ven en torre', '&lt;p&gt;Conversacion se inicio Jueves, Agosto 13 2020, 14:29&lt;br /&gt;================================================================&lt;/p&gt;&lt;p&gt;[14:28] Visitante ha navegado a https://cs.intelix.biz/chat/&lt;br /&gt;[14:29] Escritorio de Ayuda (Mensaje del Sistema) : Bienvenido, si necesita ayuda responda a este mensaje, estamos conectados para ayudarle.&lt;br /&gt;[14:29] febeca : Selecciona el cliente : 09. Mayoreo&lt;/p&gt;&lt;p&gt;Nombre : febeca&lt;/p&gt;&lt;p&gt;Correo electrónico : ventasfebeca184@gmail.com&lt;br /&gt;[14:30] Rafael Camacho : Bienvenido al Centro de Servicios Intelix. ¿En qué puedo ayudarte?&lt;br /&gt;[14:30] febeca : Hola buenas tardes&lt;br /&gt;[14:31] febeca : Al cliente 0505297 Ser y Sum Yaris le he colocado pedidos en par de oportunidades pero no suben a la torre de control, no logra sincronizar sus pedidos.&lt;br /&gt;[14:32] febeca : no aparecn los pedidos por ningun lado&lt;br /&gt;[14:33] Rafael Camacho : Me indicas los numeros de los pedidos?&lt;br /&gt;[14:35] febeca : 63154 y 63203 el primero sustituye al segundo&lt;br /&gt;[14:37] Rafael Camacho : Estoy revisando los pedidos&lt;br /&gt;[14:37] febeca : ok&lt;br /&gt;[14:43] Rafael Camacho : El cliente es nuevo?&lt;br /&gt;[14:44] febeca : no&lt;br /&gt;[14:51] Rafael Camacho : El problema se encuentra que en la torre de control no le ha replicado el sector de despacho&lt;br /&gt;[14:51] Rafael Camacho : &lt;img id="12b4774e-d9d62df8-5f358d99728a19.17124870" src="data:image/png;base64," alt="image" width="500" height="256.84931506849" /&gt;&lt;br /&gt;[14:52] febeca : ok y eso como se soluciona&lt;br /&gt;[14:53] Rafael Camacho : Dame un momento por favor&lt;br /&gt;[14:53] febeca : ok&lt;/p&gt;', 'Ramo Mayoreo', 'Febeca', 'OF/01', '18748033', 'DO > Administración de Ventas/Cobranza', 'Medium', 'Paez Arcia, Humberto Enrique ( INT-VE-169 )', '2020-08-13', '2020-08-13', NULL, NULL, '2.63', NULL, '5f3694ea11182b4d356044fc',