	('2008130170', 'No permite colocar cantidades en NDV', '&lt;div dir="ltr"&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt;Buenas Tardes, &lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt; &lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt;La presente es para que por favor, revisen el código 6-009-162 el cual no permite colocar 71 pzas en NDV.&lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt; &lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt; &lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40522&amp;tickets_id=2008130170" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40522&amp;tickets_id=2008130170" alt="12b4774e-d9d62df8-5f358ea5d14440.53151054" width="279" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Atenta &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;strong&gt;Mariangela Angulo&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;div class="gmail_signature" dir="ltr" data-smartmail="gmail_signature"&gt;&lt;div dir="ltr"&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;strong style="color: #000000; font-family: arial,helvetica,sans-serif; font-size: small;"&gt;&lt;em&gt;Dpto. de Control de Inventario&lt;/em&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;span style="color: #000000; font-size: small; font-family: arial, helvetica, sans-serif;"&gt;&lt;strong&gt;&lt;em&gt;Distribuidora Sillas California, C.A&lt;/em&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;span style="color: #000000; font-size: small; font-family: arial, helvetica