	('2008140213', 'Códigos que no permite colocar cantidades en cuarentena', '&lt;div dir="ltr"&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt;Buenas Tardes, &lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt; &lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt;Por favor, se requiere colocar en cuarentena las siguientes cantidades:&lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt; &lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt;1-077-090: 26 pzas&lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt;1-077-045: 19 pzas&lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt; &lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt;&lt;strong&gt;Bernardo, aun tenemos este inconveniente con la administración de la cuarentena. &lt;/strong&gt;&lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt; &lt;/div&gt;&lt;div class="gmail_default" style="font-family: tahoma,sans-serif; font-size: small;"&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40698&amp;tickets_id=2008140213" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40698&amp;tickets_id=2008140213" alt="12b4774e-d9d62df8-5f36eccf526df0.69929298" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Atenta &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;strong&gt;Mariangela Angulo&lt;/strong&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;div class="gmail_signature" dir="ltr" data-smartmail="gmail_signature"&gt;&lt;div dir="ltr"&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;strong style="color: #000000; font-family: arial,helvetica,sans-serif; font-size: small;"&gt;&lt;em&gt;Dpto. de Control de Inventario&lt;/em&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;span style="color: #000000; font-size: small; font-family: arial, helvetica, sans-serif;"&gt;&lt;strong&gt;&lt;em&gt;Distribuidora Sillas California, C.A&lt;/em&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;span style="color: #000000; font-size: small; font-family: arial, helvetica, sans-serif;"&gt;&lt;strong&gt;&lt;em&gt;&lt;img src="https://docs.google.com/uc?export=download&amp;id=0B1gX9AZGSn1dR3BmRU9iVGpmNm8&amp;revid=0B1gX9AZGSn1dU2ZZaDRNQWVXSHFENzhwMkhhbzRERVFzL2lFPQ" alt="image" width="96" height="48" /&gt;&lt;/em&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', 'Ramo Mayoreo', 'Sillaca', 'CD/01', '18344592', 'Logistica > Almacen Movil > Articulos', 'Medium', 'Arvelo Silva, Luis Alejandro ( INT-VE-61 )', '2020-08-14', '2020-08-14', NULL, NULL, '0.43', NULL, '5f36feba9aea9c44ddfc0287', 'true'),
	('2008140215', 'DISPARIDAD EN LISTADOS DE COBRANZA MANUAL (EN EFECTIVO $)', '&lt;div dir="ltr"&gt;Buenas Tardes!! &lt;br /&gt;&lt;br /&gt;La presente es para notificar la diferencia con las cobranzas en efectivo desde el día 12-08 en adelante, ya que aparecen en el &lt;strong&gt;total de cobranza&lt;/strong&gt; pero no en los Listados detallados de manual y automáticos el cual genera una diferencia en el cuadre contable.&lt;div&gt; &lt;/div&gt;&lt;div&gt;En el &lt;strong&gt;query de cobranza todo&lt;/strong&gt; si se reflejan pero como &lt;strong&gt;Cobranza&lt;/strong&gt; &lt;strong&gt;Automática.&lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/div&gt;&lt;div&gt;Adriana Navas nos comenta que para contabilidad se puede entregar un listado generado del query como se hace con la cobranza manual mientras se define bien lo que se va a hacer. &lt;span style="background-color: #ffff00;"&gt;Pero en el caso de&lt;strong&gt; Remuneraciones&lt;/strong&gt; si necesitamos saber como se les va a pasar la información ya que ellos &lt;strong&gt;la necesitan para el cálculo de las comisiones de los representantes de ventas &lt;/strong&gt;y no sabemos si estos recibos son tomados en cuenta o no en la programa usado por&lt;strong&gt; remuneración &lt;/strong&gt;para el cálculo de los mismos o si nosotros debemos continuar &lt;strong&gt;enviandolos&lt;/strong&gt; como cobranza manual ya &lt;strong&gt;que se pueden duplicar los pagos&lt;/strong&gt; &lt;strong&gt;de las comisiones&lt;/strong&gt; &lt;strong&gt;o se les puede dejar de pagar, &lt;/strong&gt;ya que no tenemos certeza de si ellos &lt;strong&gt;(remuneracion)&lt;/strong&gt; lo visualizan ellos en el reporte que &lt;strong&gt;Remuneraciones&lt;/strong&gt; generan.&lt;/span&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Anexo pantallas.&lt;br /&gt;&lt;br /&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;strong&gt;Pantalla cobranza total&lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40699&amp;tickets_id=2008140215" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40699&amp;tickets_id=2008140215" alt="12b4774e-d9d62df8-5f36ee34956682.50349921" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;strong&gt;Listado Cobranza Manual&lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40700&amp;tickets_id=2008140215" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40700&amp;tickets_id=2008140215" alt="12b4774e-d9d62df8-5f36ee34b80d73.96401604" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;strong&gt;Listado Cobranza Automática&lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40701&amp;tickets_id=2008140215" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40701&amp;tickets_id=2008140215" alt="12b4774e-d9d62df8-5f36ee34e1e9e2.02980154" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;-- &lt;br /&gt;&lt;div class="gmail_signature" dir="ltr" data-smartmail="gmail_signature"&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;span style="color: #3333ff; font-family: tahoma, sans-serif;"&gt;&lt;strong&gt;Valentín Guerrero.&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;&lt;div dir="ltr"&gt;&lt;span style="color: #3333ff; font-family: tahoma, sans-serif;"&gt;&lt;strong&gt;Dpto. de Crédito y Cobranza.&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', 'Ramo Mayoreo', 'Febeca', 'OF/01', '9677258', 'Legacy > Cobranza', 'Medium', 'Sierra Gonzalez, Daniel ( INT-VE-130 )', '2020-08-14', '2020-08-14', NULL, NULL, '4.5', NULL, '5f3a8ccc48800d5d6cbc4ef7', 'true'),
