	('2008170061', 'Problemas para reactivar OC con el proveedor Sealing Products', '&lt;div dir="ltr"&gt;Buenos días, gusto en saludar. &lt;div&gt; &lt;/div&gt;&lt;div&gt;Al intentar reactivar o cerrar la OC 63591 no lo permite el sistema ya que arroja error que el recibo Nº 115996 está asociado a esa orden de compra, sin embargo ese recibo fue anulado en el módulo de recepción. &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40884&amp;tickets_id=2008170061" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40884&amp;tickets_id=2008170061" alt="12b4774e-d9d62df8-5f3a946e1b32b3.11310039" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Agradecida por su acostumbrado apoyo. &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Quedo atenta a sus comentarios. &lt;br style="clear: both;" /&gt;&lt;div&gt; &lt;/div&gt;-- &lt;br /&gt;&lt;div class="gmail_signature" dir="ltr" data-smartmail="gmail_signature"&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div style="color: #888888;"&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;strong&gt;       Endreína Pérez&lt;/strong&gt;&lt;strong&gt;  &lt;/strong&gt;&lt;/div&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;strong&gt;&lt;span style="color: #444444;"&gt;  Revisoría Mercancía &lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;strong&gt;&lt;span style="color: #444444;"&gt; &lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;strong&gt;&lt;span style="color: #666666;"&gt; Directo: 0241-8740275&lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;strong&gt;&lt;span style="color: #666666;"&gt; Máster: 0241-8740200&lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;strong&gt;&lt;span style="color: #666666