	('2008170145', 'Solicitud de modificacion de estatus de documento', '&lt;div dir="ltr"&gt;Buenas Tardes Estimados, &lt;div&gt; &lt;/div&gt;&lt;div&gt;Un gusto saludarles, la presente es para solicitar su apoyo en modificar el estatus de documento de completado a borrador del recibo 122508 Factura 000093 del proveedor Inversiones Chaname el cual se completo el dia 13/08/2020 (adjunto print); esto debido a que el proveedor anuló el documento (fue sustituido por las factura 000094 y 000095) y por error de comunicación se registró la factura; cabe acotar que dicha factura se completó con regla de disponibilidad P ya que era un corte de preventa y se realizo la conciliación de la misma, &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40973&amp;tickets_id=2008170145" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40973&amp;tickets_id=2008170145" alt="12b4774e-d9d62df8-5f3ad3b31b9c66.86697158" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Sin mas, favor Frank Trujillo solicitamos tu aprobación,&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Muchas gracias y quedamos atentos a sus comentarios, &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Saludos. &lt;/div&gt;&lt;/div&gt;', 'Ramo Mayoreo', 'Febeca', 'OF/01', '20513462', 'Aplicaciones > Facturacion', 'Medium', 'Alvarez Gutierrez, Gabriel Alejandro ( INT-VE-141 )', '2020-08-17', '2020-08-17', NULL, NULL, '0', NULL, '5f3b94af4e09838ff1c83fbc', 'true'),
	('2008170158', 'RETENCION W99 DOBLE', '&lt;div dir="ltr"&gt;&lt;div class="gmail_default" style="font-family: times new roman,serif; font-size: large; color: #000000;"&gt;&lt;div class="gmail_default"&gt;Buenas tardes, &lt;/div&gt;&lt;div class="gmail_default"&gt; &lt;/div&gt;&lt;div class="gmail_default"&gt;Por favor apoyar con la retención W99 grabada dos veces por error en sistema.&lt;/div&gt;&lt;/div&gt;&lt;div class="gmail_default" style="font-family: times new roman,serif; font-size: large; color: #000000;"&gt; &lt;/div&gt;&lt;div class="gmail_default" style="font-family: times new roman,serif; font-size: large; color: #000000;"&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=40980&amp;tickets_id=2008170158" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=40980&amp;tickets_id=2008170158" alt="12b4774e-d9d62df8-5f3ad953ac4672.42517718" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Quedo atenta&lt;/div&gt;&lt;/div&gt;&lt;div class="gmail_default" style="font-family: times new roman,serif; font-size: large; color: #000000;"&gt; &lt;/div&gt;&lt;div&gt;&lt;div class="gmail_signature" dir="ltr" data-smartmail="gmail_signature"&gt;&lt;div dir="ltr"&gt;&lt;strong&gt;Ing. Alexandra Navarro &lt;/strong&gt;&lt;div&gt;&lt;strong&gt;Ejecutivo Control y Cobro&lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;strong&gt;Tlf: 0412-236-5293&lt;br /&gt;&lt;/strong&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;img src="https://pbs.twimg.com/profile_images/812026307521421312/enThGrHQ.jpg" alt="Imagen relacionada" width="96" height="96" /&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', 'Ramo Mayoreo', 'Febeca', 'OF/01', '9677258', 'Legacy > Cobranza', 'Medium', 'Sierra Gonzalez, Daniel ( INT-VE-130 )', '2020-08-17', '2020-08-17', NULL, NULL, '1.58', NULL, '5f3add618d3f2b1e625acde8', 'false'),
	('2008180108', 'PROBLEMA CON EL USO DE LA WMS ADMINISTRACIÓN DE ALMACÉN', '&lt;div dir="ltr"&gt;Buenas Tardes Contacto&lt;div&gt; &lt;/div&gt;&lt;div&gt;Por medio se les informa que la aplicación   &lt;span style="color: #000000; font-family: \';Times New Roman\'; ;font-size: medium;"&gt; &lt;/span&gt;&lt;a class="gmail-styleCod" style="color: #000000; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 11px; font-weight: bold;"&gt;WMS Mobile v3.2.1&lt;/a&gt;  está presentando error de uso, ya que el mismo no deja consultar los artículos ni mucho menos autorizar los BackOrder de Embalaje por lo que los colaboradores del apartado están retenidos en los pasillos por dicho problema,  el cual les impide finalizar el apartado.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Se requiere la pronta solución al caso.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Estamos atentos a sus comentarios.&lt;/div&gt;&lt;div&gt;&lt;div&gt; &lt;/div&gt;-- &lt;br /&gt;&lt;div class="gmail_signature" dir="ltr" data-smartmail="gmail_signature"&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;br /&gt;&lt;div&gt;&lt;div style="font-size: 12.8px;"&gt;  &lt;em&gt;Kelvin J. Castillo S.&lt;/em&gt;&lt;/div&gt;&lt;div style="font-size: 12.8px;"&gt;&lt;strong style="font-size: 12.8px;"&gt;Control de Inventario&lt;/strong&gt;&lt;/div&gt;&lt;span style="font-size: 12.8px;"&gt;    &lt;/span&gt;&lt;img style="font-size: 12.8px;" src="http://bamerica.es/wp-content/uploads/2015/04/febeca.jpg" alt="Resultado de imagen para febeca" width="96" height="48" /&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', 'Ramo Mayoreo', 'Febeca', 'CD/01', '12145275', 'Logistica > Torre de Control > Sin Acceso', 'Medium', 'León Morales, Williams Daniel ( INT-VE-242 )', '2020-08-18', '2020-08-18', NULL, NULL, '0.5', NULL, '5f3c1e56531a0216dcc24d00', 'true'),
	('2008180109', 'caída de sistema almacén movil.', '&lt;div dir="ltr"&gt;   Buenas tardes desde las 12:30 estamos presentando fallas para aprobación de back order y consulta de artículos por la aplicación de almacén movil...&lt;div&gt; &lt;/div&gt;&lt;div&gt;Solicitamos de su colaboración al respecto..&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=41093&amp;tickets_id=2008180109" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=41093&amp;tickets_id=2008180109" alt="12b4774e-d9d62df8-5f3c0af5793109.93609249" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', 'Ramo Mayoreo', 'Febeca', 'CD/01', '12145275', 'Logistica > Torre de Control > Sin Acceso', 'Medium', 'León Morales, Williams Daniel ( INT-VE-242 )', '2020-08-18', '2020-08-18', NULL, NULL, '0.5', NULL, '5f3c1ebf4f26cd84f50f3e3d', 'true'),
	('2008180123', 'Campo Rotación - Mvto en Meses', '&lt;div dir="ltr"&gt;Buenas Tardes, gusto saludarles.&lt;div&gt; &lt;/div&gt;&lt;div&gt;El presente es para solicitar información de cómo se está calculando el campo \';Rotación\'; dentro del movimiento en Meses, ya que es necesario conocer cómo está actualmente para validar si se está haciendo el cálculo correctamente según la necesidad actual.&lt;br style="clear: both;" /&gt;&lt;div&gt;&lt;div class="gmail_signature" dir="ltr" data-smartmail="gmail_signature"&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt; &lt;/div&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=41106&amp;tickets_id=2008180123" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=41106&amp;tickets_id=2008180123" alt="12b4774e-d9d62df8-5f3c120b12ccd2.55742965" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div dir="ltr"&gt; &lt;/div&gt;&lt;div dir="ltr"&gt;&lt;div&gt;Quedo atenta ante cualquier comentario y/o sugerencia.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;¡Gracias, feliz día!&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;/div&gt;&lt;div dir="ltr"&gt;&lt;img src="https://drive.google.com/a/mayoreo.biz/uc?id=1HirLEoElRjbZZFzIFc8OOD15N45uNPDb&amp;export=download" alt="image" width="420" height="197" /&gt;&lt;/div&gt;&lt;div dir="ltr"&gt; &lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', 'Ramo Mayoreo', 'Prisma', 'OF/01', '19698356', 'DO > Reportes Comerciales', 'Medium', 'Hernandez Salcedo, David Javier ( INT-VE-60 )', '2020-08-18', '2020-08-18', NULL, NULL, '0', NULL, '5f3d26d3f2576a18d75f3791', 'false'),
	('2008180137', 'Nota de Crédito no replica en el kardex', '&lt;div dir="ltr"&gt;Buenas tardes.&lt;div&gt; &lt;/div&gt;&lt;div&gt;Por favor revisar el siguiente código 2-014-148 ya que se emitió nota de crédito por parte del proveedor y no replica en el sistema, me sigue apareciendo existencia comercial y contable.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=41111&amp;tickets_id=2008180137" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=41111&amp;tickets_id=2008180137" alt="12b4774e-d9d62df8-5f3c1a6a9d5fa6.66348652" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Quedo atento a sus comentarios. &lt;/div&gt;-- &lt;br /&gt;&lt;div class="gmail_signature" dir="ltr" data-smartmail="gmail_signature"&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;img src="https://docs.google.com/uc?export=download&amp;id=13v58az1uqgAQx3VQ1kP8P7pWhBy56DIh&amp;revid=0Bxm4ubGnT71cdm5HWlVyYW9nSld2SW54Q3cwRFRiM0xCL2NZPQ" alt="image" width="200" height="75" /&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', 'Ramo Mayoreo', 'Beval', 'CD/01', '18344592', 'DO > Devoluciones al Proveedor', 'Medium', 'Arvelo Silva, Luis Alejandro ( INT-VE-61 )', '2020-08-18', '2020-08-18', NULL, NULL, '1.67', NULL, '5f3c86d63b20c3405505fb31', 'false'),
	('2008180157', 'Existencia Errada código 0-709-045', '&lt;div dir="ltr"&gt;Buenas tardes.&lt;div&gt; &lt;/div&gt;&lt;div&gt;El siguiente código 0-709-045 tiene una Existencia comercial de 108pz de la cuales entiendo que 36pz son por un ajuste y que se encuentran en el área de devoluciones por averías, pero las 72pz restantes desconozco su existencia, por lo que decidí revisar el kardex, según mi análisis en el código solo se deben reflejar 36pz.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Mi análisis se basó en las cantidades que se contaron en TFI las cuales coincidieron con el R4&lt;/div&gt;&lt;div&gt;   &lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=41134&amp;tickets_id=2008180157" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=41134&amp;tickets_id=2008180157" alt="12b4774e-d9d62df8-5f3c2b4cacde08.20577496" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;de allí reste las ventas después del día 18 que sería la fecha del inventario eso me llevaría el código a 0.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Por otra parte, según lo que pude observar el código siempre ha sido N pero aun así las 72pz que me faltan solo me aparecen el la existencia comercial no en la contable, como que si el código tuviese disponibilidad por nota de entrega.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=41135&amp;tickets_id=2008180157" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=41135&amp;tickets_id=2008180157" alt="12b4774e-d9d62df8-5f3c2b4ccc7474.46003207" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Quedo atento a sus comentarios.&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt; &lt;/div&gt;-- &lt;br /&gt;&lt;div class="gmail_signature" dir="ltr" data-smartmail="gmail_signature"&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;div dir="ltr"&gt;&lt;img src="https://docs.google.com/uc?export=download&amp;id=13v58az1uqgAQx3VQ1kP8P7pWhBy56DIh&amp;revid=0Bxm4ubGnT71cdm5HWlVyYW9nSld2SW54Q3cwRFRiM0xCL2NZPQ" alt="image" width="200" height="75" /&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', 'Ramo Mayoreo', 'Beval', 'CD/01', '18344592', 'Logistica > Almacen Movil > Articulos', 'Medium', 'Arvelo Silva, Luis Alejandro ( INT-VE-61 )', '2020-08-18', '2020-08-18', NULL, NULL, '0', NULL, '5f3c8763531a0216dcd34f39', 'false'),
	('2008190159', 'MODIFICAR CÓDIGO DE RETENCIÓN 25 75 876 VEMCO VALENCIA C.A', '&lt;div dir="ltr"&gt;&lt;span style="font-size: large;"&gt;Buenas tardes, &lt;/span&gt;&lt;div&gt;&lt;span style="font-size: large;"&gt; &lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style="font-size: large;"&gt;Por favor modificar código de retención &lt;strong&gt;W99 a W98&lt;/strong&gt; a las siguientes facturas:&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;strong&gt;&lt;span style="font-size: large;"&gt; &lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;span style="font-size: large;"&gt;19 06 20 A05868268&lt;strong&gt;&lt;br /&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style="font-size: large;"&gt;16 06 20 A05872757&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style="font-size: large;"&gt; &lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;p&gt;&lt;a href="https://cs.intelix.biz/front/document.send.php?docid=41265&amp;tickets_id=2008190159" target="_blank" rel="noopener"&gt;&lt;img src="https://cs.intelix.biz/front/document.send.php?docid=41265&amp;tickets_id=2008190159" alt="12b4774e-d9d62df8-5f3d6ec9f16dc5.06575350" width="500" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt; &lt;/div&gt;&lt;div&gt;Saludos, &lt;/div&gt;&lt;/div&gt;', 'Ramo Mayoreo', 'Prisma', 'OF/01', '9677258', 'Legacy > Cobranza', 'Medium', 'Sierra Gonzalez, Daniel ( INT-VE-130 )', '2020-08-19', '2020-08-19', NULL, NULL, '0', NULL, '5f3e7c234d7afe0f81e4fc90', 'false'),
	('2008190160', 'Error en Recepción', '&lt;p&gt;Buen d&iacute;a,&lt;/p&gt;&lt;p&gt;Al momento de Revesar la recepci&oacute;n del recibo de mercanc&iacute;a 76804 del proveedor Inversiones Marfil de Oro, muestra el siguiente error&nbsp;&lt;/p&gt;&lt;p&gt;&nbsp;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;/front/document.send.php?docid=41266&amp;tickets_id=2008190160&quot; target=&quot;_blank&quot; &gt;&lt;img alt=&quot;12b4774e-d9d62df8-5f3d6f81c74882.79138432&quot; width=&quot;565.0446280991736&quot; src=&quot;/front/document.send.php?docid=41266&amp;tickets_id=2008190160&quot; /&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&nbsp;&lt;/p&gt;', 'Ramo Mayoreo', 'Sillaca', 'CD/01', '18344592', 'Logistica > Torre de Control > Recepcion', 'Medium', 'Arvelo Silva, Luis Alejandro ( INT-VE-61 )', '2020-08-19', '2020-08-19', NULL, NULL, '0', NULL, '5f3d745b651d93706fc1b506', 'false'),
